import { Dropdown } from 'react-bootstrap'
import { useHistory } from 'react-router-dom';
export default function NavbarAdmin(){
    let history = useHistory()
    const logout =()=>{
        
            sessionStorage.setItem('isLogin',false);
            localStorage.removeItem("token");
            history.push('/')
    }
    return(
        <>
        <div id="nav-admin" style={{display:'flex',justifyContent:"space-between",marginLeft:87,height:120}}>
            <img style={{width:167,height:64,marginTop:34}} src = { require('../assets/Group 4.png').default }/> 
            
            <Dropdown id="dropdown-basic-button">
            <Dropdown.Toggle style={{borderRadius:50,width:50,height:50}} id="dropdown-basic">Menu</Dropdown.Toggle>
                <Dropdown.Menu>
                    <Dropdown.Item onClick={logout} ><img src={require('../assets/logout 1.png').default}/>Logout</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
        </div>
        </>
    )
}
